import React from 'react';
import {
  Avatar,
  IconButton,
  List,
  ListItem,
  ListItemAvatar,
  ListItemIcon,
  ListItemSecondaryAction,
  ListItemText,
  Menu,
  MenuListItem
} from '@material-ui/core';
import {
  Error as ErrorIcon,
  MoreVert as VerticalMenuIcon,
  Warning as WarningIcon
} from '@material-ui/icons';

import { alertData } from '../data';

const onClick = () => {
    console.log('click');
};

const pickIcon = (type) => {
  if (type === "alert"){
    return <WarningIcon />
  } else {
    return <ErrorIcon />
  };
};

export default function AlertDetail(){
  return(
    <List>
      {alertData.map((alert) =>
        <ListItem key={alert.id}>
          <ListItemAvatar>
            <Avatar>
              {pickIcon(alert.type)}
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary={alert.detail} />
          <ListItemSecondaryAction>
            <IconButton onClick={onClick}>
              <VerticalMenuIcon />
            </IconButton>
            <Menu>
              <MenuListItem>Delete</MenuListItem>
            </Menu>
          </ListItemSecondaryAction>
        </ListItem>
      )}
    </List>
  );
}
